import React from 'react';
import {navbar} from './Components/Navbar'
import './App.css';

function App() {
  return (
    <div className="App">

        <div id="Greeting">
        Hi,<br/>
        I'm Henry<br/>
        I do all sorts of things.<br/>
        please have a look.
        </div>
    </div>
  );
}

export default App;
